import React from 'react'
import { Card, CardItem }  from 'vertical-timeline-component-for-react'
import Board from '../Boad'

const card = props => {
    const { board } = props
    return (
        <Card animate={false} lineColor={'#00C853'}>
            {
                board.map((c, key) => (
                    <CardItem key={key} dateStyle={{ display: 'none' }}>
                        <Board board={c}/>
                    </CardItem>
                ))
            }
        </Card>
    )
}

export default card
